import React from 'react';
import { motion } from 'framer-motion';
import { ExternalLink, Github, Globe } from 'lucide-react';
import './Projects.css';

interface Project {
  id: number;
  title: string;
  description: string;
  technologies: string[];
  image: string;
  githubUrl?: string;
  liveUrl?: string;
  category: string;
}

const Projects: React.FC = () => {
  const projects: Project[] = [
    {
      id: 1,
      title: "PixelGram",
      description: "Designed and developed a fault-tolerant distributed systems based web application with high availability & scalability which can be used to share, upload, download and organize photos employing the Micro-Services Architectural pattern. Built a CI/CD pipeline using Jenkins to deploy the containerized microservices on a Kubernetes cluster running on a cloud VM instance setup on Jetstream. Used Google Drive as the photo storage and leveraged GIT effectively for the source code and project management.",
      technologies: ["React", "Node", "Flask", "Docker", "Jenkins", "Kubernetes", "RabbitMQ", "Apache JMeter", "SQLite DB", "Jetstream"],
      image: "/api/placeholder/400/300",
      githubUrl: "https://github.com/yourusername/pixelgram",
      liveUrl: "https://pixelgram-demo.com",
      category: "Full Stack"
    },
    {
      id: 2,
      title: "Hoosier Rally",
      description: "Designed and developed a user-friendly online event management portal for the Hoosiers to organise, watch out and register to events happening in indiana. Multiple sign-up options have been provided for user flexibility and has multi-factor authentication enabled to improve security. The dashboard has a calendar view and bookmark feature to improve the user experience.",
      technologies: ["React JS", "Node JS", "Firebase Auth", "Firebase Realtime DB", "Git", "Twilio", "HTML", "CSS"],
      image: "/api/placeholder/400/300",
      githubUrl: "https://github.com/yourusername/hoosier-rally",
      liveUrl: "https://hoosier-rally.com",
      category: "Web App"
    },
    {
      id: 3,
      title: "E-Commerce Platform",
      description: "A modern e-commerce platform built with React and Node.js, featuring user authentication, product management, shopping cart functionality, and payment integration. Includes admin dashboard for inventory management and order processing.",
      technologies: ["React", "Node.js", "Express", "MongoDB", "Stripe", "JWT", "Redux"],
      image: "/api/placeholder/400/300",
      githubUrl: "https://github.com/yourusername/ecommerce",
      liveUrl: "https://ecommerce-demo.com",
      category: "Full Stack"
    }
  ];

  return (
    <section id="projects" className="projects section">
      <div className="container">
        <motion.div
          className="section-header"
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6 }}
          viewport={{ once: true }}
        >
          <h2 className="section-title">Recent Projects</h2>
          <p className="section-subtitle">
            A collection of personal and university projects, where I've applied product development and project management principles to develop creative and practical solutions.
          </p>
        </motion.div>

        <div className="projects-grid">
          {projects.map((project, index) => (
            <motion.div
              key={project.id}
              className="project-card"
              initial={{ opacity: 0, y: 50 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.6, delay: index * 0.1 }}
              viewport={{ once: true }}
            >
              <div className="project-image">
                <div className="image-placeholder">
                  <div className="placeholder-text">
                    <span>{project.title}</span>
                    <small>Project Preview</small>
                  </div>
                </div>
                <div className="project-overlay">
                  <div className="project-links">
                    {project.githubUrl && (
                      <a
                        href={project.githubUrl}
                        target="_blank"
                        rel="noopener noreferrer"
                        className="project-link"
                      >
                        <Github size={20} />
                      </a>
                    )}
                    {project.liveUrl && (
                      <a
                        href={project.liveUrl}
                        target="_blank"
                        rel="noopener noreferrer"
                        className="project-link"
                      >
                        <Globe size={20} />
                      </a>
                    )}
                  </div>
                </div>
              </div>

              <div className="project-content">
                <div className="project-header">
                  <h3 className="project-title">{project.title}</h3>
                  <span className="project-category">{project.category}</span>
                </div>

                <p className="project-description">{project.description}</p>

                <div className="project-technologies">
                  {project.technologies.map((tech, techIndex) => (
                    <span key={techIndex} className="tech-tag">
                      {tech}
                    </span>
                  ))}
                </div>

                <div className="project-actions">
                  {project.githubUrl && (
                    <a
                      href={project.githubUrl}
                      target="_blank"
                      rel="noopener noreferrer"
                      className="btn btn-secondary"
                    >
                      <Github size={16} />
                      View Code
                    </a>
                  )}
                  {project.liveUrl && (
                    <a
                      href={project.liveUrl}
                      target="_blank"
                      rel="noopener noreferrer"
                      className="btn btn-primary"
                    >
                      <ExternalLink size={16} />
                      Live Demo
                    </a>
                  )}
                </div>
              </div>
            </motion.div>
          ))}
        </div>

        <motion.div
          className="projects-cta"
          initial={{ opacity: 0, y: 20 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6, delay: 0.4 }}
          viewport={{ once: true }}
        >
          <a href="https://github.com/yourusername" target="_blank" rel="noopener noreferrer" className="btn btn-primary">
            View All Projects
          </a>
        </motion.div>
      </div>
    </section>
  );
};

export default Projects;
